import React from 'react';
import './App.css';
import TradingViewWidget from 'react-tradingview-widget';

function App() {

let small = TradingViewWidget.width = 'auto'
let heighty = TradingViewWidget.height = '500px'
let themey = TradingViewWidget.theme = 'Dark' ;
let interval = TradingViewWidget.interval= "60" 
let indicators =  TradingViewWidget.studies = [ "Volume@tv-basicstudies",  "TripleEMA@tv-basicstudies",  "RSI@tv-basicstudies"]

// console.log(typeof Trading)
// console.log(Trading.width)
// console.log(indicators[0])


return (



<div className="App">

<TradingViewWidget

    symbol="BITSTAMP:BTCUSD"
    theme={themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    style='8'
    interval={interval}
    studies={indicators}  

    rangeTypes='ALL' 

      // autoSize='true' 
    width={small}
    height={heighty}
    className="Trading"      
/>

<TradingViewWidget
    symbol="BITSTAMP:ETHUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={small}
    height={heighty}
    style='8'
    interval={interval}
    studies={indicators}  
    className="Trading"          
  />

</div>

);
}

export default App;
